import React from "react";
import Card from './Card'
import contacts from "../contacts"

function App(props) {
  return (
      <div>
        <Card name = {contacts[0].name} image = {contacts[0].imgURL} tel = {contacts[0].phone} email= {contacts[0].email}  />
      </div> 
  )

}

export default App;
